script: |
  super -f text -I q11100.spq | sort > q11100.out

inputs:
  - name: q11100.spq
    data: |
      SELECT DISTINCT + CAST ( NULL AS INTEGER ) AS col2 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT - col0 + - 2 NOT BETWEEN NULL AND - + col0 + - - CAST ( NULL AS INTEGER ) * - col1;
  - name: tab1

outputs:
  - name: q11100.out
    data: |
